import React from "react"

import NovaProjekcijaForm from "./NovaProjekcijaForm"

class NovaProjekcija extends React.Component{
    constructor(){
        super()
        this.state = {

        }
        this.handleSubmit=this.handleSubmit.bind(this)
        this.handleChange=this.handleChange.bind(this)
    }

    handleSubmit(){
        console.log("Handle submit")
    }

    handleChange(event){
        const {name,value} = event.target
        this.setState({
            [name]:value
        })
    }

    render(){
        return(
            <div id="NovaProjekcija">
                <NovaProjekcijaForm state={this.props.state} handleSubmit={this.handleSubmit}/>
            </div>
        )
    }
}

export default NovaProjekcija
